import React from "react";
import Play from "./components/play";
import Users from "./components/users";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      selectPage: 1,
    };
  }
  render() {
    return <div>{this.state.selectPage ? <Users /> : <Play />}</div>;
  }
  playShou = () => {
    this.setState({ selectPage: "" });
  };
}

export default App;
